import React from 'react';
import { Component } from 'react';


class Section extends Component {
   render(){
   return(
   
      <div>
        
           
             <div className='container bg:red'>
                 
                     <div className='column'>MEDICINES TIMER</div>
                     <div className="column">NUTRITION</div>
                     <div className="column">MEDATION</div>
                     <div className="column">QUOTES</div>
                 </div>
             

    </div>
   
   )
}
}




export default Section;
